		.group {
			position: relative;
			button.dropdownToggle {
				position: relative;
				border: 1px solid #ddd;
				padding-right: 20px;
				padding-left: 20px;
				.inner {
					margin-right: 20px;
				}
				svg {
					position: absolute;
					right: 10px;
					top: 12px;
				}
			}
		}
		.dropdownMenu {
			width: 100%;
			position: absolute;
			top: 40px;
			display: block;
			font-size: 14px;
			border-radius: 3px;
			border: 1px solid #ddd;
		}
		.dropdownItem {
			padding: 6px 16px;
			cursor: pointer;
			text-align: center;
			&:hover {
				background-color: #eeeded;
			}
		}
	}
`;
